values:
&nbsp;Okay well let me just tell you a few things that happened yesterday.

&nbsp;First, it was another regular day at school but afterwards my mom and I took the subway down to Bay and went to the Indigo there. I bought the latest Teen Vogue with Mischa Barton on the cover (I LOVE HER) and also this book called "Loving Will Shakespeare" which is about his wife, Anne Hathaway. So, anyways I realised the Film Festival's in town so my mom and I were talking about seeing certain stars and getting a job at Indigo when we saw this red carpet and the street blocked off.&nbsp;

&nbsp;Well, my mom and I are naturally curious so we stopped and went to go see what was going on. Lo and behold we see a BIG sign saying, "Twenty8Twelve by S. Miller"&nbsp;

&nbsp;Yes, that would be Sienna Miller. Well, then we just HAD to wait around for three hours (standing....I've got the sore thighs to prove it &gt;&lt;)&nbsp;There was two people on stilts and fire eaters and jugglers, like at a circus. They were really talented.&nbsp;Well, around 9:30, her limo pulled up and there she is....Sienna Miller in person. It was so COOL!

&nbsp;She was wearing black, skinny jeans with this incredibly high heels, a white blouse and a top hat. She had this really tall blonde lady in a black cocktail dress with her. She flashed us a smile and then went to give the paparazzi their photographs and was interviewed. More people started arriving&nbsp;but I didn't recognise any of them.&nbsp;

&nbsp;Closer to ten, she comes over to say hi to all the people who waited. She waved and gave us a closer look, she's pretty and thin and really short. I was taller than her and she was wearing three inch heels. But she didn't sign autographs and she didn't really talk with any of the fans. Which I thought was kinda rude but what're you gonna do?

&nbsp;And that's the most exciting thing that's happened to me this month, of course the month is just beginning so who knows who I'll meet next? Maybe Jared Padalecki ^_-
